(()=>{"use strict";class t{constructor(t,r,s,h,n,a=[],o){this.name=t,this.city=r,this.country=s,this.tagline=h,this.price=n,this.tags=a,this.portrait=o}photographerBlock(){return`\n            <article>\n                <a href="">\n                <img src="img/index/${this.portrait}" height="200px" width="200px" alt="">\n                <h2>${this.name}</h2>\n            </a>\n\n            <span class="location">${this.city}, ${this.country}</span>\n            <span>${this.tagline}</span>\n            <span class="price">${this.price}â‚¬/jour</span>\n\n            <div class="tag-list">${this.tags}</div>\n            </article>\n        `}}fetch("data.json").then((t=>{if(t.ok)return t.json()})).then((r=>{for(let s=0;s<r.photographers.length;s++){let h=new t(r.photographers[s].name,r.photographers[s].city,r.photographers[s].country,r.photographers[s].tagline,r.photographers[s].price,r.photographers[s].tags,r.photographers[s].portrait);document.getElementById("photographers-list").innerHTML+=h.photographerBlock()}})).catch((t=>{console.log(t)}))})();